export const TestAutoCompleteSearchComponent = () => {

    const handleSubmit = (e) => {
        e.preventDefault();
    }


    return (
        <>
            <section id="search-component">
                <form id="search-form" onSubmit={value => handleSubmit(value)}>
                    <div className="mb-3 d-flex w-100">
                        <label
                            htmlFor="exampleInputEmail1search-field"
                            className="form-label">
                            {/* <AutoComplete /> */}
                        </label>
                        <button
                            type="submit"
                            value="Submit"
                            className={`btn btn-dark`}
                        >
                            Zoek adviseurs
                        </button>
                    </div>
                </form>
            </section >
        </>
    );
}
